import React from 'react';

import { ReactComponent as Logo } from '../logo.svg';

import './header.styles.css';


const Header = () => (
    <div id="header">
        <div id="headerImage">
            <Logo className='logo'/>
        </div>

        <div class="headerText">

        </div>

        <nav>
            <a href="#">Home</a>
            <a href="#">About</a>
            <a href="#">Contact</a>
        </nav>
    </div>
);

export default Header;
